import React from 'react';
import "../assets/css/footer.scss";

export default class Footer extends React.Component {
    render() {
        return (
            <div className="footer-container">
                <div className="footer">
                    <div>
                        hello
                    </div>
                    <div>
                        <text style={{fontSize: "11px"}}><em>Icons: </em><br/></text>
                        <div className="icon-link">Home icon made by <a href="https://www.flaticon.com/authors/bqlqn" title="bqlqn">bqlqn</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div>
                        <div className="icon-link">Ministry icon made by <a href="https://www.flaticon.com/authors/freepik" title="Freepik">Freepik</a> from <a href="https://www.flaticon.com/" title="Flaticon"> www.flaticon.com</a></div>
                        <div className="icon-link">Donate icon made by <a href="https://www.flaticon.com/authors/freepik" title="Freepik">Freepik</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div>
                        <div className="icon-link">Instagram icon made by <a href="https://www.flaticon.com/authors/pixel-perfect" title="Pixel perfect">Pixel perfect</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div>
                    </div>
                </div>
            </div>
       )
    }
}
